import React from "react";
import "./About.css";

const About = () => {
  // 기능 구현 로직
  return (
    <div id="about">
      <div class="About">
        <div class="inner">
          <h1>ABOUT</h1>
        </div>
      </div>
      <div class="profile">
        <div class="inner">
          <p class="left">신입 프론트엔드 개발자 고윤혁</p>

        </div>
      </div>
    </div>
  );
};

export default About;
